import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Card";
import Sdata from "./Sdata"



ReactDOM.render(
  <>
    <h1 className=" text-center m-5 " >This Is Official Netflix Site</h1>

    <Card
       imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        Link={Sdata[0].Link}
    />

    <Sdata/>
  </>,

  document.getElementById("root")
)
